        { "type": "investimentoTeste2", "date": "27/03/2019Teste2", "value": 777 },
      ]
    }
  }

  render () {
    const {tasksDoServidor} = this.state;

    return (
      <Row>
        <div></div>
        <Table className="highlight centered">
            <thead>
              <tr>
